import React    from 'react';
import { Link } from 'react-router-dom';

function Register () {
  return (
    <>

      <form className='auth'>
        <h2 className='auth__title'>Регистрация</h2>
        <input type='email' 
               className='auth__input auth__input_type_email'
               placeholder='Email'
               defaultValue='' />
        <input type='password'
               className='auth__input auth__input_type_password'
               placeholder='Пароль'
               defaultValue='' />
        <button type='submit'
                className='auth__submit'>Зарегистрироваться</button>
        <p className='auth__tip'>Уже зарегистрированы? <Link to='/sign-in' class='auth__link'>Войти</Link></p>
      </form>  
    </>
  )
}

export default Register;
